import React, {useState, useEffect} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  let json = useState(1);

  useEffect(() => {
    fetch('http://127.0.0.1:5000/map')
  .then(res =>
    res.text()).then(data => console.log(data));
}, []);

// console.log(data);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {json}
        </p>

      </header>
    </div>
  );
}

export default App;
